drop database if exists projetoIntegrador;
create database projetoIntegrador ;
use projetoIntegrador;

/*-------------------------------------------------------------------------------------------ELEÇÕES 2008 -------------------------------------------------------------------------------------------------------------------*/



CREATE TABLE eleitor_idade_2008(
   id  INTEGER 
  ,idade     VARCHAR(8) NOT NULL
  ,masculino NUMERIC(7,3) NOT NULL
  ,porc_mas  VARCHAR(6) NOT NULL
  ,feminino  NUMERIC(7,3) NOT NULL
  ,porc_fem  VARCHAR(6) NOT NULL
  ,s_indef   NUMERIC(6,3) NOT NULL
  ,porc_ind  VARCHAR(5) NOT NULL
  ,total     VARCHAR(9) NOT NULL
  ,porc_tot  VARCHAR(7) NOT NULL
);


 

CREATE TABLE sexo_escol_2008(
   id       INTEGER  
  ,escolaridade VARCHAR(24) NOT NULL
  ,masculino    NUMERIC(7,3) NOT NULL
  ,porc_m       VARCHAR(6) NOT NULL
  ,feminino     NUMERIC(7,3) NOT NULL
  ,porc_f       VARCHAR(6) NOT NULL
  ,s_indefinido NUMERIC(6,3) NOT NULL
  ,porc_ind     VARCHAR(5) NOT NULL
  ,total        VARCHAR(9) NOT NULL
  ,porc_tot     VARCHAR(7) NOT NULL
);














CREATE TABLE ELEICAO_2008_PREFEITO_VEREADOR (	
	ID_ELEICOES_2008 INT(10)
	,MUNICIPIO  VARCHAR(8) NOT NULL
	,CARGO      VARCHAR(8) NOT NULL
	,CANDIDATO  VARCHAR(42) NOT NULL
	,NR         INTEGER  NOT NULL
	,PARTIDO    VARCHAR(7) NOT NULL
	,SITUACAO   VARCHAR(10) NOT NULL
	,QT_VOTOS_VALIDOS    NUMERIC(6,3) NOT NULL
	,PORCENTAGEM_VOTOS_VALIDOS  VARCHAR(20) NOT NULL
	,UF         VARCHAR(2) NOT NULL
);

















/*-------------------------------------------------------------------------------------------ELEÇÕES 2012 -------------------------------------------------------------------------------------------------------------------*/








CREATE TABLE eleitor_idade_2012(
   id INTEGER 
  ,idade     VARCHAR(7) NOT NULL
  ,masculino NUMERIC(7,3) NOT NULL
  ,porc_mas  VARCHAR(6) NOT NULL
  ,feminino  NUMERIC(7,3) NOT NULL
  ,porc_fem  VARCHAR(6) NOT NULL
  ,total     VARCHAR(9) NOT NULL
  ,porc_tot  VARCHAR(7) NOT NULL
);


CREATE TABLE sexo_escol_2012(
   id  INTEGER
  ,escolaridade VARCHAR(29) NOT NULL
  ,masculino    NUMERIC(7,3) NOT NULL
  ,porc_mas     VARCHAR(6) NOT NULL
  ,feminino     NUMERIC(7,3) NOT NULL
  ,porc_fem     VARCHAR(6) NOT NULL
  ,s_indef      INTEGER  NOT NULL
  ,porc_ind     VARCHAR(5) NOT NULL
  ,total        VARCHAR(9) NOT NULL
  ,porc_tot     VARCHAR(7) NOT NULL
);












DROP TABLE IF EXISTS ELEICOES_2012_PREFEITO_VEREADOR_1TURNO;
CREATE TABLE ELEICOES_2012_PREFEITO_VEREADOR_1TURNO(
	ID_ELEICOES_2012_1T INT(10)
	,UF               VARCHAR(2) NOT NULL
	,MUNICIPIO       VARCHAR(8) NOT NULL
    ,CARGO           VARCHAR(8) NOT NULL /*prefeito ou verador*/
	,NR              NUMERIC(6,3) NOT NULL
	,CANDIDATO        VARCHAR(47) NOT NULL
	,PARTIDO          VARCHAR(7) NOT NULL
	,SITUACAO         VARCHAR(16) NOT NULL
	,QT_VOTOS_VALIDOS NUMERIC(10) NOT NULL
	,PORCENTAGEM_VOTOS_VALIDOS  VARCHAR(20) NOT NULL
);



CREATE TABLE ELEICOES_2012_PREFEITO_2TURNO(
	ID_ELEICOES_2012_2T INT(10)
	,UF               VARCHAR(2) NOT NULL
	,MUNICIPIO        VARCHAR(8) NOT NULL
	,CARGO            VARCHAR(8) NOT NULL
	,NR               INT  NOT NULL
	,CANDIDATO        VARCHAR(27) NOT NULL
	,PARTIDO          VARCHAR(3) NOT NULL
	,SITUACAO         VARCHAR(10) NOT NULL
	,QT_VOTOS_VALIDOS NUMERIC(10) NOT NULL
	,PORCENTAGEM_VOTOS_VALIDOS VARCHAR(20) NOT NULL
);

























/*-------------------------------------------------------------------------------------------ELEÇÕES 2016 -------------------------------------------------------------------------------------------------------------------*/







CREATE TABLE ELEICOES_2016_PREFEITO_VEREADOR_1TURNO(
	ID_ELECOES_2016_1T 			 INT(10)
	,UF                          VARCHAR(2) NOT NULL
	,MUNICIPIO                   VARCHAR(8) NOT NULL
	,CARGO                       VARCHAR(8) NOT NULL
