CREATE TABLE ELEICOES_2016_PREFEITO_2TURNO(
	 ID_ELEICOES_2016_2T	   INT(10)
	,UF                        VARCHAR(2) NOT NULL
	,MUNICIPIO                 VARCHAR(8) NOT NULL
	,CARGO                     VARCHAR(8) NOT NULL
	,NUMERO_CANDIDATO          INT(20)  NOT NULL
	,NOME_CANDIDATO            VARCHAR(32) NOT NULL
	,PARTIDO                   VARCHAR(3) NOT NULL
	,COLIGACAO                 VARCHAR(45) NOT NULL
	,TURNO                     INT(20)  NOT NULL
