/*-------------------------------------------------------------------------------------------CHAVES PRIMARIAS - MODIFICAÇÕES -------------------------------------------------------------------------------------------------------------------*/


ALTER TABLE ELEICAO_2008_PREFEITO_VEREADOR
	MODIFY ID_ELEICOES_2008 int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT ELEICAO_2008_PREFEITO_VEREADOR_ID_ELEICOES_2008 PRIMARY KEY CLUSTERED (ID_ELEICOES_2008) ;
   
ALTER TABLE eleitor_idade_2008
	MODIFY id int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT eleitor_idade_2008_id PRIMARY KEY CLUSTERED (id) ;
    
ALTER TABLE sexo_escol_2008
	MODIFY id int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT sexo_escol_2008_id PRIMARY KEY CLUSTERED (id) ;





ALTER TABLE ELEICOES_2012_PREFEITO_VEREADOR_1TURNO
	MODIFY ID_ELEICOES_2012_1T int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT ELEICOES_2012_PREFEITO_VEREADOR_1TURNO_ID_ELEICOES_2012_1T PRIMARY KEY CLUSTERED (ID_ELEICOES_2012_1T) ;
    
ALTER TABLE ELEICOES_2012_PREFEITO_2TURNO
	MODIFY ID_ELEICOES_2012_2T int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT ELEICOES_2012_PREFEITO_2TURNO_ID_ELEICOES_2012_2T PRIMARY KEY CLUSTERED (ID_ELEICOES_2012_2T) ;
    
ALTER TABLE eleitor_idade_2012
	MODIFY id int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT eleitor_idade_2012_id PRIMARY KEY CLUSTERED (id) ;

ALTER TABLE sexo_escol_2012
	MODIFY id int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT sexo_escol_2012_id PRIMARY KEY CLUSTERED (id) ;



ALTER TABLE ELEICOES_2016_PREFEITO_VEREADOR_1TURNO
	MODIFY ID_ELECOES_2016_1T int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT ELEICOES_2016_PREFEITO_VEREADOR_1TURNO_ID_ELECOES_2016_1T PRIMARY KEY CLUSTERED (ID_ELECOES_2016_1T) ;
    
ALTER TABLE ELEICOES_2016_PREFEITO_2TURNO
	MODIFY ID_ELEICOES_2016_2T int(11) NOT NULL AUTO_INCREMENT,
	ADD CONSTRAINT ELEICOES_2016_PREFEITO_VEREADOR_2TURNO_ID_ELECOES_2016_2T PRIMARY KEY CLUSTERED (ID_ELEICOES_2016_2T) ;
    





